import  React, {Component,ReactNode} from 'react';
import './Header.css';

type Props = {
    i:string,
    a:string,

    }

export default class Header extends Component<Props>{
    render(){
       let {i,a,b,c,d}=this.props;
        return(

          <div className = "nav_bar">
              <i className="material-icons icn">{i}</i>
              <p id = 'pos_a'>{a}</p>
              <p id = 'pos_b'>hell</p>
              <p id = 'pos_c'>hell</p>
              <p id = 'pos_d'>hell</p>
          </div>
        );

    }
}
